package com.house.dto;

public class LikeyDTO2 {
	private int lidx;
	private int midx;
	private int hidx;
	
	public LikeyDTO2() {
		super();
		// TODO Auto-generated constructor stub
	}

	public LikeyDTO2(int lidx, int midx, int hidx) {
		super();
		this.lidx = lidx;
		this.midx = midx;
		this.hidx = hidx;
	}

	public int getLidx() {
		return lidx;
	}

	public void setLidx(int lidx) {
		this.lidx = lidx;
	}

	public int getMidx() {
		return midx;
	}

	public void setMidx(int midx) {
		this.midx = midx;
	}

	public int getHidx() {
		return hidx;
	}

	public void setHidx(int hidx) {
		this.hidx = hidx;
	}
	
	
}
